// https://leetcode.com/problems/longest-substring-without-repeating-characters/description/

use std::cmp::max;
use std::collections::{HashMap, HashSet};

use stdext::prelude::*;

fn no_dup(s: &str) -> bool {
    s.chars().collect::<HashSet<_>>().len() == s.len()
}

pub fn answer1(s: String) -> i32 {
    let mut longest = 0;
    for i in 0..s.len() {
        for j in 0..s.len() - i {
            let substr = &s[i..i + j + 1];
            if no_dup(substr) && substr.len() > longest {
                longest = substr.len();
            }
        }
    }
    longest as i32
}

pub fn answer(s: String) -> i32 {
    let mut last_appear = HashMap::new();
    let mut start = 0;
    let mut longest = 0;
    for (i, c) in s.chars().enumerate() {
        match last_appear.get(&c) {
            Some(prev) if *prev >= start => start = prev + 1,
            None => {
                ("Longest substr: ", s.substr(start, i + 1)).log();
                longest = max(longest, i - start + 1)
            },
            _ => {}
        }
        last_appear.entry(c).and_modify(|prev| *prev = i).or_insert(i);
    }
    longest as i32
}

